	7:	WS_2_PP_2_TON(IN:=TRUE,PT:=T#1S);
		WHILE WS_2_PP_2_TON.Q DO
			FM_WS_2_PP_2_ROTCW:=TRUE;
			WS_2_PP_2_STEP:=8;
			WS_2_PP_2_TON(IN:=FALSE);
		END_WHILE

	8: WS_2_PP_2_STEP:=0;
END_CASE

FM_WS_2_PP_1_MOVX:=FALSE;
FM_WS_2_PP_1_ROTCCW:=FALSE;
FM_WS_2_PP_1_ROTCW:=FALSE;
FM_WS_2_M_START:=FALSE;
FM_WS_2_WARNINGL:=FALSE;
FM_WS_2_PP_2_MOVX:=FALSE;
FM_WS_2_PP_2_ROTCCW:=FALSE;
FM_WS_2_PP_2_ROTCW:=FALSE;

CASE CPS_RESET_STEP OF

	0:	FM_CPS_PP_MOVX:=FALSE;
		FM_CPS_PP_ROTCCW:=TRUE;
		CPS_RESET_STEP:=1;

	1:	CPS_RESET_FALLEDGE(CLK:=FM_CPS_PP_ROTATING);
		WHILE CPS_RESET_FALLEDGE.Q DO
			FM_CPS_PP_ROTCCW:=FALSE;
			CPS_RESET_STEP:=2;
			CPS_RESET_FALLEDGE(CLK:=FALSE);
		END_WHILE

	2:	CPS_RESET_STEP:=0;

END_CASE
